import React from 'react';
import PropTypes from 'prop-types';

const ProfileTop = ({
     profile
}) => {
    console.log(profile);
    return (
        <div>
            Hi
        </div>
    );
};

ProfileTop.propTypes = {
    profile:PropTypes.object.isRequired
};

export default ProfileTop;
